// Metadata for HomePage.js images and their positions
// Update or expand as needed for new images or layout changes

export const homePageImageMeta = [
  {
    name: 'leo',
    src: require('../assets/images/leo.png'),
    alt: 'flamingo 4',
    position: { section: 'top', grid: { row: 1, col: 1 } },
    width: 100,
    height: 59
  },
  {
    name: 'group5',
    src: require('../assets/images/Group 5.png'),
    alt: 'flamingo 4',
    position: { section: 'top', grid: { row: 1, col: 2 } },
    width: 100,
    height: 93
  },
  {
    name: 'flamingo1',
    src: require('../assets/images/flamingo 1.png'),
    alt: 'world 5',
    position: { section: 'top', grid: { row: 1, col: 3 } },
    motion: true,
    transitionDuration: 3
  },
  {
    name: 'jadePortrait',
    src: require('../assets/images/jade portrait 1.png'),
    alt: 'world 5',
    position: { section: 'top', grid: { row: 1, col: 4 } },
    motion: true,
    transitionDuration: 2
  },
  {
    name: 'discoBall',
    src: require('../assets/images/disco ball 1.png'),
    alt: 'world 5',
    position: { section: 'middle', grid: { row: 2, col: 1 } },
    motion: true,
    transitionDuration: 3
  },
  {
    name: 'gingerbreadHouse',
    src: require('../assets/images/gingerbread house 1.png'),
    alt: 'flamingo 4',
    position: { section: 'middle', grid: { row: 2, col: 3 } }
  }
];
